<p style="text-align: center;"><span style="font-size: 15pt; color: #0000ff;">AYO ?</span></p>
<p>&nbsp;</p>
<p>Le <strong>cr&eacute;ole mauricien</strong>, <strong>morisien</strong> pour les intimes, a un statut de langue &agrave; part enti&egrave;re. Malgr&eacute; cela, sa pr&eacute;sence sur internet est peu r&eacute;pandue.</p>
<p>Kifer do ?, me direz vous. Eh bien comme beaucoup de cr&eacute;oles, il est consid&eacute;r&eacute; comme une langue peu dot&eacute;e dans le domaine du traitement automatique de la langue. Il n&rsquo;existe &agrave; ce jour <strong>peu d&rsquo;outils et de ressources num&eacute;riques</strong> pour le morisien. La cr&eacute;ation de ces outils permettrait que plus de locuteurs du morisien produisent du <strong>contenu sur Internet</strong> et que les apprenants de la langue aient des <strong>outils de r&eacute;f&eacute;rence fiables</strong> &agrave; leur disposition !</p>
<p>Pour que ces outils aient la chance de voir le jour, nous avons besoin de donn&eacute;es particuli&egrave;res : <strong>les donn&eacute;es annot&eacute;es</strong> (du texte o&ugrave; les mots sont associ&eacute;s &agrave; leur cat&eacute;gorie grammaticale) en morisien - et comme vous vous en doutez, il n&rsquo;en existe pas non plus.</p>
<p style="text-align: center;">C&rsquo;est l&agrave; que vous rentrez en jeu ! Gr&acirc;ce &agrave; votre participation sur <strong>AYO !</strong> nous allons cr&eacute;er <strong>ensemble</strong> le premier &laquo; corpus annot&eacute; &raquo; du cr&eacute;ole mauricien.</p>
<p style="text-align: center;"><strong>Vous, locuteurs du cr&eacute;ole mauricien</strong> &ecirc;tes les mieux plac&eacute;s pour construire cette ressource alors &agrave; vos claviers !</p>
<p style="text-align: center;">&nbsp;</p>
<p style="text-align: center;"><span style="font-size: 15pt; color: #0000ff;">Qui suis-je ?</span></p>
<p style="text-align: center;">&nbsp;</p>
<p style="text-align: center;"><strong>All&ocirc; la terre, ici Harmonie !</strong></p>
<p style="text-align: center;">&nbsp;</p>
<p style="text-align: center;"><strong><span style="font-family: verdana, geneva;"><img style="display: block; margin-left: auto; margin-right: auto;" src="data:image/jpeg;base64," alt="" width="200" height="300" /></span></strong></p>
<p style="text-align: left;">&nbsp;</p>
